import React, { useState } from "react";
import type { Meta, StoryObj } from "@storybook/react";
import { Post } from "./Post";
const meta: Meta<typeof Post> = {
  title: "Post",
  component: Post
};
export default meta;
type PostType = StoryObj<typeof meta>;
export const NewPost: PostType = {
  args: {
    message: 'New',
    likesCount: 2
  }
};
NewPost.parameters = {
  ...NewPost.parameters,
  docs: {
    ...NewPost.parameters?.docs,
    source: {
      originalSource: "{\n  args: {\n    message: 'New',\n    likesCount: 2\n  }\n}",
      ...NewPost.parameters?.docs?.source
    }
  }
};
